<script>
    $(document).ready(function() {
        $('.item-has-children').click(function() {
            $('.item-has-children').removeClass('active');
            $(this).addClass('active');
        });
    });


    $(document).ready(function() {
        var url = window.location.href;
        $('.item-has-children').each(function() {
            var menuItemUrl = $(this).find('a').attr('href');
            if (url.indexOf(menuItemUrl) !== -1) {
                $(this).addClass('active');
            }
        });
    });

    $(document).ready(function() {
        var url = window.location.href;
        $('.sub-menu li').each(function() {
            var menuItemUrl = $(this).find('a').attr('href');
            if (url.indexOf(menuItemUrl) !== -1) {
                $(this).addClass('active');
                $(this).closest('.item-has-children').addClass('active');
                $(this).closest('.item-has-children').find('.sub-menu').css('display', 'block');
            }
        });
    });



    function logOut() {
        fetch('signOutProcess.php', {
                method: "GET"
            })
            .then(res => res.text())
            .then(data => {
                alert(data)
                if (data == "Success") {
                    window.location.reload();
                }
            })
            .catch(error => {
                console.error("Error :", error);
            });
    }
</script>